import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
  <Switch>
          <Route path="/create">
            <Create />
          </Route>
          <Route path="/join">
            <Join />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
  </Router>
  );
}

function Home() {
  return <div>
            <h2>Home</h2>
              <div className="button-list-landing-page">
                <Link to="/create" className="main-btn">Create Game</Link>
                <Link to="/join" className="main-btn">Join Game</Link>
              </div>
        </div>;
}



function Create() {
  function handleSubmit(e){
    alert("you clicked submit. Value was:" + this.state.value);
    e.preventDefault();
  }

  function handleChange(e){
    this.setState({value: e.target.value})
  }
  return <div>
            <h2>Create a game</h2>
            <Link to="/" className="main-btn">Main page</Link>
            <div className="create-game-form">
                <form onSubmit={handleSubmit}>
                  <label>
                    Gamesize
                  <input type="text" value={this.state.value} onChange={this.handleChange}></input>
                  </label>
                  <button type="submit">Create game</button>
                </form>
            </div>
        </div>;
}

function Join() {
  return  <div>
              <h2>Join a game</h2>
              <Link to="/" className="main-btn">Main page</Link>
          </div>;
}

export default App;
